    //     <Container>
    //       {/* <h1>Welcome!</h1> */}
    //       <HomeScreen />
    //     </Container>
    //   </main>
    //   <Footer />
    // </div>
    <Router>
      <Header />
      <main className="py-3">
        <Container>
          <Routes>
            <Route path="/" Component={HomeScreen} exact />
            <Route path="/product/:id" Component={ProductScreen} />
          </Routes>
        </Container>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
